import React from 'react'

function Resume() {
  const datas = window.localStorage.getItem('obj')
  const rData =JSON.parse(datas)
  return (
    <div>
      {rData.name}
      {rData.Lastname}
      {rData.Gail}
      {rData.Address}
      {rData.Dateofbirth}
      {rData.Qualification}
      {rData.name}
      {rData.name}















    </div>
  )
}

export default Resume
